import React from 'react';
import styles from './index.module.css';

const Login = () => {
  return(
    <div>
      <header>
        <div>
          <h1 className={styles.logo}><img src='/assets/logo_palpitebox.png' alt='logo'/></h1>
        </div>
      </header>
      <section>
        <div>
          <p>EMAIL</p>
          <p>SENHA</p>
        </div>
      </section>
      <footer>
        <div>
          SuggestIn Box!
        </div>
      </footer>
    </div>
  );
}

export default Login;
